import React from 'react';

const Banner = () => {
  return (
    <div className="container-fluid gtco-banner-area">
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <h1>
              We promise to bring the best <span>solution</span> for your business.
            </h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In rhoncus turpis nisl.</p>
            <a href="#">
              Contact Us <i className="fa fa-angle-right" aria-hidden="true"></i>
            </a>
          </div>
          <div className="col-md-6">
            <div className="card">
              <img className="card-img-top img-fluid" src="images/banner-img.png" alt="" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Banner;
